body {
  /* font-family: "Merriweather", serif; */
  font-family: "Sedan", serif;
  /* font-family: "proxima-nova", sans-serif; */
  background: #e1e4f5;
  /* #efe8fa */
  color: #1f1235;
}

input {
  font-family: "Work Sans", sans-serif;
}
.number {
  font-family: "Montserrat", sans-serif;
}

#top-banner {
  width: 100%;
  border-radius: 10px;
  padding-top: 10px;
  padding-bottom: 10px;
  background: #232946;
}

#company-name {
  display:inline;
  position: relative;
  font-size: 70px;
  font-family: "Space Grotesk", sans-serif;
  margin: 0;
  color: #fffffe;
  text-decoration: underline;

}

#sign-up {
  width: 12%;
  height: 6vh;
  border-radius: 10px;
  float: right;
  border: 1px solid black;

  font-size: 15px;
  margin-right: 40px;
  margin-top: 20px;

  background: #b8c1ec;
  /* color: #232946; */
  cursor: pointer;

  box-shadow: 4px 4px black;
}


#contact-provider {
  width: 12%;
  height: 6vh;
  float: left;
  border: 1px solid black;
  font-size: 15px;

  margin-left: 40px;
  margin-top: 20px;

  background: #eebbc3;
  box-shadow: 4px 4px black;
  border-radius: 10px;
  cursor: pointer;

}

/* /////////////////////
        MAIN
///////////////////// */

#main #header {
  font-size: 45px;
  margin-left: 10%;
  margin-top: 7vh;
  width: 90%;
  font-family: "Merriweather", serif;
  color: #232946;
}

#main #input {
  width: 55%;
  background: #fffffe;
  height: 50vh;
  float: right;
  margin-right: 100px;
  position: relative;
  top: 3vh;

  border-radius: 35px;
  border: 3px solid #ffc354;
  box-shadow: 15px 15px #b8c1ec;
}

#main input {
  width: 75%;
  position: relative;
  top: 8vh;
  margin-bottom: 4vh;
  height: 35px;
  border-radius: 3px;
  border: 2px solid #232946;
  padding-left: 10px;
  font-size: 16px;
}

#main #search {
  position: relative;
  top: 15vh;
  width: 82%;
  height: 40px;
  border-radius: 3px;
  border: 2px solid black;
  cursor: pointer;

  background: #5fb4b7;
  color: #153031;
  font-size: 17px;
  transition: all 1s ease-in-out;
  font-family: "Space Grotesk", sans-serif;
}

#main #search:hover {
  border: 3px dotted black;
  transition: all 0.5s ease-in-out;
}

/* /////////////////////
        CHATBOT
///////////////////// */

#chatbox {
    position: fixed;
    bottom: 0;
    height: 50%;
    right: 30px;
    width: 20%;
    background-color: #fff;
    box-shadow: 0 0 10px rgba(0,0,0,0.2);
    border-radius: 8px 8px 0 0;
    overflow: hidden;
    font-size: 14px;
    z-index: 100;
    display: none;
}

.chatbox-header {
    background-color: #4CAF50;
    color: #fff;
    padding: 10px;
    position: relative;
}

.close-btn {
    position: absolute;
    top: 10px;
    right: 10px;
    border: none;
    background: none;
    color: white;
    cursor: pointer;
}

.chatbox-messages {
    height: 200px;
    overflow-y: auto;
    padding: 10px;
    background: #f9f9f9;
}

.message {
    margin-bottom: 15px;
}

.agent, .guest {
    display: flex;
    align-items: flex-start;
}

.agent-img {
    width: 40px;
    height: 40px;
    border-radius: 50%;
    margin-right: 10px;
}

.name {
    font-weight: bold;
}

.agent .text, .guest {
    background-color: #e7e7e7;
    padding: 10px;
    border-radius: 4px;
}

.guest {
    background-color: #d1edc1;
    align-self: flex-end;
}

/* /////////////////////
        RESULTS
///////////////////// */

#results {
}

#results #choose-insurance {
  width: 65%;
  background: white;
}

#results #input {
  float: left;
  margin: 35px;
  width: 50%;
}

#results input {
  height: 40px;
  width: 30%;
  padding-left: 20px;
  border: 2px solid black;
  font-size: 16px;
}

#results #search {
  width: 70%;
  float: left;
  position: relative;
  height: 40px;
  border-radius: 3px;
  border: 2px solid black;
  margin-top: 15px;
  cursor: pointer;

  background: #5fb4b7;
  color: #153031;
  font-size: 17px;
  transition: all 1s ease-in-out;
  font-family: "Space Grotesk", sans-serif;
}

#results #filters {
  border: 1px solid black;
  width: 35%;
  height: 55vh;
  margin-left: 35px;

  position: relative;
  top: 23vh;
}

/* Dropdown Button */
.dropbtn {
 background-color: #04AA6D;
 color: white;
 padding: 16px;
 font-size: 16px;
 border: none;
 cursor: pointer;
}

/* Dropdown button on hover & focus */
.dropbtn:hover, .dropbtn:focus {
 background-color: #3e8e41;
}

/* The search field */
#myInput {
 box-sizing: border-box;
 background-position: 14px 12px;
 background-repeat: no-repeat;
 font-size: 16px;
 padding: 14px 20px 12px 45px;
 border: none;
 border-bottom: 1px solid #ddd;
}

/* The search field when it gets focus/clicked on */
#myInput:focus {
  outline: 3px solid #ddd;
}

/* The container <div> - needed to position the dropdown content */
.dropdown {
 position: relative;
 display: inline-block;
}

/* Dropdown Content (Hidden by Default) */
.dropdown-content {
 display: none;
 position: absolute;
 background-color: #f6f6f6;
 min-width: 230px;
 border: 1px solid #ddd;
 z-index: 1;
}

/* Links inside the dropdown */
.dropdown-content a {
 color: black;
 padding: 12px 16px;
 text-decoration: none;
 display: block;
}

/* Change color of dropdown links on hover */
.dropdown-content a:hover {background-color: #f1f1f1}

/* Show the dropdown menu (use JS to add this class to the .dropdown-content container when the user clicks on the dropdown button) */
.show {display:block;}

#results #plan {
  position: relative;
}

#results #data {
  width: 60%;
  height: 80vh;
  top: 20%;
  right: 15px;
  position: absolute;

  float: right;
}

#results #data-header {
  font-size: 45px;
  position: relative;

}

#results #data {
  margin-top: 20px;
  overflow: auto;
}

.card {
    border: 3px solid black;
    margin-bottom: 20px;
    border-radius: 10px;
    width: 75%; /* Adjust as needed */
    margin-top: 10px;
}

.header {
    display: flex;
    border-top-left-radius: 10px;
    border-top-right-radius: 10px;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 20px;
    background: #fffffe;
    padding: 15px;
}

.price-info {
    text-align: right;
}

.hospital-name {
    font-size: 18px;
    font-weight: bold;
}

.cash-price,
.your-price {
    display: block;
    color: #333;
}

.add-insurance-button {
  width: 105%;
  padding: 2.5px 5px;
  margin-top: 5px;
  font-size: 15px;
  text-align: center;
  color: #232946;
  border: 2px solid #232946;
  border-radius: 5px;
  background-color: transparent;
  text-decoration: none;
  display: inline-block;
  cursor: pointer;

  transition: .3s ease-in-out
}

.add-insurance-button:hover {
  background: #232946;
  color: white;
}

.your-price {
    color: green;
    font-weight: bold;
}

.service-info {
    margin-bottom: 20px;
}

.service-title {
    font-size: 16px;
    font-weight: bold;
    margin: 0 0 10px 0;
}

.service-address {
    margin: 0;
    color: #666;
}

.distance {
    display: block;
    color: #333;
    margin-top: 5px;
    float: right;
    margin-right: 10px;
}

.appointment-btn {
    background-color: #eebbc3;
    color: black;
    border: none;
    padding: 10px 20px;
    text-align: center;
    text-decoration: none;
    display: inline-block;
    font-size: 16px;
    margin-right: 35%;
    margin-bottom: 30px;
    cursor: pointer;
    border-radius: 4px;
    font-family: "Space Grotesk", sans-serif;
}

/* /////////////////////
    MAKE APPOINTMENT
///////////////////// */

#appointment #user-data {
  width: 30%;
  margin-left: 13vw;
  float: left;
  font-family: "Work Sans", sans-serif;
}

#appointment .user-data-input {
  width: 75%;
  height: 40px;
  margin-top: 30px;
  border: 2.5px solid black;
  border-radius: 10px;
  padding-left: 10px;

  font-weight: 550;
  user-select: none;
  font-size: 16px;

  outline: none;
  transition: all .3s ease-in-out;
}

#appointment .user-data-input:focus {
  box-shadow: 3px 3px #232946;
}

#appointment #appointment-availability {
  float: right;
  margin-right: 8vw;

  width: 40%;
  font-family: "Work Sans", sans-serif;
}

#appointment .appointment-header {
  font-size: 18px;
}

#appointment-availability .appointment-date-first {
  margin-top: -2px;
}

#appointment-availability .appointment-date {
  margin-top: 25px;
}

#appointment-availability .appointment-input-first {
  width: 100%;
  height: 35px;

  /* top-left | top-right | bottom-right | bottom-left */
  border-radius: 4px 4px 0 0;
  border: 2px solid black;

  border-bottom: none;
  background-color: white;
  text-align: left;

  font-size: 18px;
  margin-top: 15px;
  padding-top: 10px;
  padding-left: 10px;

}

#appointment-availability .appointment-input {
  width: 100%;
  height: 35px;

  /* top-left | top-right | bottom-right | bottom-left */
  border-radius: 0 0 4px 4px;
  border: 2px solid black;

  background-color: white;
  text-align: left;

  font-size: 18px;
  /* margin-top: 5px; */
  padding-top: 10px;
  padding-left: 10px;
}

#appointment #book-btn {
  width: 20%;
  height: 35px;

  position: relative;
  left: 22.5%;
  top: 15vh;

  border: 1px solid black;
  border-radius: 8px;
  cursor: pointer;
  background: #ffd87d;

}
